import HeaderPage from './HeaderPage';
import NextHeader from './NextHeader'
import pic6 from './teslaimg/vlad-tchompalov-jwyO3NhPZKQ-unsplash.jpg'
import model3back from './teslaimg/model-y_R1@2.jfif'
const Model3 = () => {
    return ( 
        <div>
      <HeaderPage
         title="Model 3"
         background={model3back}
         description="Hyper"
         range="450km"
         time="3.1s"
         speed="250km/h"
         horsepower="1,100hp"
         first
      />
      <NextHeader 
        title="Your Sport Car"
        background={pic6} />
      </div> 
    );
}
 
export default Model3;
